import Website_logo from './components/Home Page Comp/WE';

const Header = () => {
  return (
    <div id="header">
      <div id="logo-container">
        <Website_logo />
        <Logo_Name logo_clicked={logo_name} />
      </div>
      <div id="profile-container">
        <Profile_Pic />
      </div>
    </div>
  );
};

export default Header;
